import React, { useState } from "react";

const handleItemClick = (e, { name }) => this.setState({ activeItem: name });

const DBoardTemplate = (props) => {
  const [activeItem, setActiveItem] = useState("overview");

  return (
    <div>
      <div className="ui massive borderless menu">
        <a className="item" href="/#">
          <i className="th icon"></i>
        </a>
        <div className="header item">
          <img src={process.env.PUBLIC_URL + "/extracy.png"} alt="team logo" />
        </div>
        <div className="right item">
          <a href="https://www.google.ca/" className="vertically fitted item">
            <i className="question circle icon"></i>
          </a>
          <a href="https://www.youtube.com/" className="vertically fitted item">
            <i className="settings icon"></i>
          </a>
        </div>
      </div>

      {props.content}
    </div>
  );
};

export default DBoardTemplate;
